import React from "react";
import {Algorithm} from "./algorithms/algorithm_interface";

interface AnimatorProps {
    algorithm: Algorithm;
}

const Animator: React.FC<AnimatorProps> = ({ algorithm }) => {
    return (
        <div>
            <h1>Algorithm Animator</h1>
            {algorithm.display()}
        </div>
    );
};

export default Animator;
